(829, 7468, 0, 2, 0, 2, '[{\"head\":1, \"body\":1, \"leg\":1, \"bag\":-1}]', 'Thẻ Lợn lòi', 'Lợn lòi có sở thích mài răng nanh dưới đất, vô tình tạo ra những rãnh đất để người Namec trồng trọt', '[{\"id\":77,\"param\":1,\"activeCard\":0},{\"id\":77,\"param\":2,\"activeCard\":1},{\"id\":77,\"param\":3,\"activeCard\":2}]', 828, 2, -1),
(830, 7469, 0, 2, 0, 3, '[{\"head\":1, \"body\":1, \"leg\":1, \"bag\":-1}]', 'Thẻ Quỷ đất', 'Bản tính của Qủy đất khá nhút nhát, chúng thường núp vào cây khi gặp người lạ', '[{\"id\":103,\"param\":1,\"activeCard\":0},{\"id\":103,\"param\":2,\"activeCard\":1},{\"id\":103,\"param\":3,\"activeCard\":2}]', 829, 2, -1),
(831, 7470, 1, 2, 0, 4, '[{\"head\":1, \"body\":1, \"leg\":1, \"bag\":-1}]', 'Thẻ Khủng long mẹ', 'Hai chi trước của Khủng long rất ngắn nên chúng không thể cầm thức ăn được', '[{\"id\": 94, \"param\": 1, \"activeCard\": 0}, {\"id\": 94, \"param\": 2, \"activeCard\": 1}, {\"id\": 94, \"param\": 3, \"activeCard\": 2}]', 830, 2, -1),
(832, 7471, 1, 2, 0, 5, '[{\"head\":1, \"body\":1, \"leg\":1, \"bag\":-1}]', 'Thẻ Lợn lòi mẹ', 'Lợn lòi có sở thích mài răng nanh dưới đất, vô tình tạo ra những rãnh đất để người Namec trồng trọt', '[{\"id\": 14, \"param\": 1, \"activeCard\": 0}, {\"id\": 14, \"param\": 2, \"activeCard\": 1}, {\"id\": 14, \"param\": 3, \"activeCard\": 2}]', 831, 2, -1),
(833, 7472, 1, 2, 0, 6, '[{\"head\":1, \"body\":1, \"leg\":1, \"bag\":-1}]', 'Thẻ Quỷ đất mẹ', ' Bản tính của Qủy đất khá nhút nhát, chúng thường núp vào cây khi gặp người lạ', '[{\"id\": 50, \"param\": 3, \"activeCard\": 0},\n{\"id\": 50, \"param\": 4, \"activeCard\": 1},\n{\"id\": 50, \"param\": 5, \"activeCard\": 2}]', 832, 2, 1),
(834, 7473, 2, 2, 0, 7, '[{\"head\":1, \"body\":1, \"leg\":1, \"bag\":-1}]', 'Thẻ Thằn lằn bay', 'Thằn lằn bay dùng cái mỏ dài và cứng để tấn công kẻ thù, đôi khi chúng vẫn dùng để gõ hạt óc chó ăn', '[{\"id\":77,\"param\":3,\"activeCard\":0},{\"id\":77,\"param\":4,\"activeCard\":1},{\"id\":77,\"param\":5,\"activeCard\":2}]', 833, 2, -1),
(835, 7474, 2, 2, 0, 8, '[{\"head\":1, \"body\":1, \"leg\":1, \"bag\":-1}]', 'Thẻ Phi long', 'Dùng tốc độ cực nhanh để tiếp cận và hạ gục mục tiêu, Phi long cũng có sở thích hơi lạ là khi bay luôn mở to miệng để đón gió', '[{\"id\":103,\"param\":3,\"activeCard\":0},{\"id\":103,\"param\":4,\"activeCard\":1},{\"id\":103,\"param\":5,\"activeCard\":2}]', 834, 2, -1),
(836, 7475, 2, 2, 0, 9, '[{\"head\":1, \"body\":1, \"leg\":1, \"bag\":-1}]', 'Thẻ Quỷ bay', 'Sở trường tấn công chớp choáng kẻ thù, nhưng đâu ai ngờ Quỷ bay lại có bệnh sợ độ cao', '[{\"id\": 94, \"param\":3, \"activeCard\": 0}, {\"id\": 94, \"param\": 4, \"activeCard\": 1}, {\"id\": 94, \"param\": 5, \"activeCard\": 2}]', 835, 2, -1),
(837, 7476, 3, 2, 0, 34, '[{\"head\":1, \"body\":1, \"leg\":1, \"bag\":-1}]', 'Thẻ Lính độc nhãn', 'Người ta nuôi quân lính dùng trong 1 giờ, Lính độc nhãn thì không dùng được 5 phút', '[{\"id\": 7, \"param\":30, \"activeCard\": 0}, {\"id\": 0, \"param\": 5, \"activeCard\": 1}, {\"id\": 6, \"param\": 50, \"activeCard\": 2}]', 836, 2, -1),
(838, 7477, 3, 2, 0, 35, '[{\"head\":1, \"body\":1, \"leg\":1, \"bag\":-1}]', 'Thẻ Lính độc nhãn', 'Người ta nuôi quân lính dùng trong 1 giờ, Lính độc nhãn thì không dùng được 5 phút', '[{\"id\": 50, \"param\": 3, \"activeCard\": 0},\n{\"id\": 50, \"param\": 4, \"activeCard\": 1},\n{\"id\": 50, \"param\": 5, \"activeCard\": 2}]', 837, 2, -1),
(839, 7478, 3, 2, 0, 36, '[{\"head\":1, \"body\":1, \"leg\":1, \"bag\":-1}]', 'Thẻ Sói xám', 'Được lính độc nhãn thuần hóa và cho giữ nhà như cún con, sở thích của chúng là được chơi trò nhặt bóng', '[{\"id\":77,\"param\":3,\"activeCard\":0},{\"id\":77,\"param\":4,\"activeCard\":1},{\"id\":77,\"param\":5,\"activeCard\":2}]', 838, 2, -1),
(840, 7480, 3, 2, 1, 1, '[{\"head\":141, \"body\":142, \"leg\":143, \"bag\":-1}]', 'Thẻ Trung úy Trắng', 'Thân hình hơi béo so với tiêu chuẩn chung, luôn đeo chiếc khăn quàng đỏ, thường hay mơ mộng làm thơ', '[{\"id\":103,\"param\":3,\"activeCard\":0},{\"id\":103,\"param\":4,\"activeCard\":1},{\"id\":103,\"param\":5,\"activeCard\":2}]', 839, 2, -1),
(841, 7481, 3, 2, 1, 1, '[{\"head\":123, \"body\":124, \"leg\":125, \"bag\":-1}]', 'Thẻ Ninja Áo Tím', 'Ninja với nhiều tài năng để trở thành sát thủ, nhưng kỹ thuật ẩn thân lại không có, nên không thể trở thành sát thủ', '[{\"id\": 94, \"param\":3, \"activeCard\": 0}, {\"id\": 94, \"param\": 4, \"activeCard\": 1}, {\"id\": 94, \"param\": 5, \"activeCard\": 2}]', 840, 2, -1),
(842, 7479, 3, 2, 1, 1, '[{\"head\":135, \"body\":136, \"leg\":137, \"bag\":64}]', 'Thẻ Trung úy Xanh Lơ', 'Có siêu năng lực thôi miên nhưng cực kỳ sợ chuột', '[{\"id\": 7, \"param\":30, \"activeCard\": 0}, {\"id\": 0, \"param\": 5, \"activeCard\": 1}, {\"id\": 6, \"param\": 50, \"activeCard\": 2}]', 841, 2, -1),
(859, 1568, 4, 2, 1, 1, '[{\"head\":144, \"body\":145, \"leg\":146, \"bag\":-1}]', 'Thẻ Độc Nhãn', 'Đầu não của Red Ribbon. Bị chột một mắt. Lúc nhỏ bị mọi người chê là \'Thằng lùn\'', '[{\"id\": 50, \"param\": 5, \"activeCard\": 0},\n{\"id\": 50, \"param\": 7, \"activeCard\": 1},\n{\"id\": 50, \"param\": 10, \"activeCard\": 2}]', 842, 2, -1),
(1257, 12640, 5, 2, 1, 1, '[{\"head\":1351, \"body\":1352, \"leg\":1353, \"bag\":-1}]', 'Thẻ Hutao', 'Sự quan tâm đặc biệt đối với cái chết và cuộc sống sau cái chết. Luôn tìm kiếm những phương pháp để bảo vệ linh hồn và tìm hiểu về bí mật của cuộc sống và cái chết', '[{\"id\": 103, \"param\": 5, \"activeCard\": 0},\n{\"id\": 103, \"param\": 7, \"activeCard\": 1},\n{\"id\": 103, \"param\": 10, \"activeCard\": 2}]', 859, 2, -1),
(1258, 12680, 5, 2, 1, 1, '[{\"head\":1354, \"body\":1355, \"leg\":1356, \"bag\":-1}]', 'Thẻ Xiao', 'Kỹ năng nguyên tố của Xiao cho phép anh biến thành một hình dạng quỷ đầy sức mạnh trong một khoảng thời gian ngắn', '[{\"id\": 77, \"param\": 5, \"activeCard\": 0},\n{\"id\": 77, \"param\": 7, \"activeCard\": 1},\n{\"id\": 77, \"param\": 10, \"activeCard\": 2}]', 1257, 2, -1),
(1259, 12714, 5, 2, 1, 1, '[{\"head\":1357, \"body\":1358, \"leg\":1359, \"bag\":-1}]', 'Thẻ Ayaka', 'Là một người quyết tâm và kiên nhẫn. Không dễ bị lùi bước bởi những khó khăn và luôn cố gắng vượt qua mọi trở ngại để đạt được mục tiêu của mình', '[{\"id\": 5, \"param\": 3, \"activeCard\": 0},\n{\"id\": 5, \"param\": 5, \"activeCard\": 1}]', 1258, 2, -1),
(1358, 18297, 6, 2, 1, 1, '[{\"head\":1396, \"body\":1397, \"leg\":1398, \"bag\":74}]', 'Thẻ Bulma Ả Rập', 'Ả Rập Xê Út, chuyên gia đánh boom sát thương cực cao', '[{\"id\": 50, \"param\": 5, \"activeCard\": 0},\n{\"id\": 50, \"param\": 10, \"activeCard\": 1},\n{\"id\": 5, \"param\": 10, \"activeCard\": 2}]', 1259, 2, -1);
