INSERT INTO `task_main_template` (`id`, `NAME`, `detail`) VALUES
(0, 'Nhiệm vụ đầu tiên', 'Chi tiết nhiệm vụ'),
(1, 'Nhiệm vụ tập luyện', 'Mộc nhân được đặt nhiều tại %1, ngay trước nhà ông %2\r\nHãy đánh ngã 5 mộc nhân, \r\nsau đó quay về nhà báo cáo với ông %2\r\nĐể đánh, hãy chạm nhanh 2 lần vào đối tượng\r\nThưởng 1000 sức mạnh\r\nThưởng 1000 tiềm năng\r\nThưởng 200k vàng'),
(2, 'Nhiệm vụ tìm thức ăn', 'Tìm đến %3, tiêu diệt bọn quái %4 và nhặt về 10 đùi gà\nThưởng 1500 sức mạnh\nThưởng 1500 tiềm năng\nThưởng 300k vàng\nHọc được kỹ năng bay'),
(3, 'Tìm kiếm sao băng', 'Đi khám phá xem vật thể lạ vừa rơi xuống hành tinh\nThưởng 2000 sức mạnh\nThưởng 2000 tiềm năng\nThưởng 400k vàng'),
(4, 'Nhiệm vụ khó khăn', 'Đi tới %6, tiêu diệt lũ %4 mẹ\nThưởng 2500 sức mạnh\nThưởng 2500 tiềm năng\nThưởng 500k vàng'),
(5, 'Nhiệm vụ gia tăng sức mạnh', 'Hãy đi tập luyện để gia tăng sức mạnh\nThưởng 3000 sức mạnh\nThưởng 3000 tiềm năng\nThưởng 500k vàng'),
(6, 'Nhiệm vụ trò chuyện', 'Đi tới trạm tàu vũ trụ, trò chuyện với %7'),
(7, 'Nhiệm vụ giải cứu', 'Lên đường tiêu diệt bọn %9, giải cứu %8\nQuay về báo cáo với %7 để nhận thưởng'),
(8, 'Nhiệm vụ ân nhân xuất sắc', 'Về %1, gặp và trò chuyện với %8\nSau đó về nhà kể lại mọi chuyện với ông %2'),
(9, 'Nhiệm vụ tiên học lễ', 'Tìm đường tới %11, trò chuyện với %10 và xin làm đệ tử'),
(10, 'Nhiệm vụ học phí', 'Tiêu diệt %12 thể hiện sức mạnh cho %10 thấy'),
(11, 'Nhiệm vụ kết giao', 'Thể hiện thiện chí đoàn kết\nMở rộng các mối quan hệ\nKết bạn với người chưa có bang hội'),
(12, 'Nhiệm vụ xin phép', 'Quay về nhà xin ông %2 cho phép tham gia bang hội cái bang'),
(13, 'Nhiệm vụ gia nhập bang hội', 'Gia nhập hoặc lập 1 bang hội để làm nhiệm vụ tiếp theo'),
(14, 'Nhiệm vụ bang hội lần 1', 'Lên đường làm nhiệm vụ\r\nGợi ý:\r\nHeo rừng xuất hiện tại rừng Bamboo\r\nHeo da xanh xuất \r\nhiện tại núi hoa vàng\r\nHeo xayda xuất hiện tại rừng cọ\r\nHãy tới trạm tàu vũ trụ để có thể di chuyển qua các map'),
(15, 'Nhiệm vụ bang hội lần 2', 'Chẳng mong hai chữ Anh Em. Chỉ mong nhiệm vụ hoàn thành xong xuôi.'),
(16, 'Tiêu diệt quái vật', 'Tới các hành tinh tiêu diệt quái vật, giải cứu thường dân'),
(17, 'Nhiệm vụ giúp đỡ Cui', 'Tìm đường tới thành phố Vegeta, gặp và nói chuyện với Cui'),
(18, 'Nhiệm vụ bất khả thi', 'Tiêu diệt đàn em tay sai của Fide tại Xayda'),
(19, 'Frieza Saga', 'Tiêu diệt đàn em tay sai của Fide'),
(20, 'Frieza Saga', 'Tiêu diệt 5 tên trong đội Tiểu Đội Sát Thủ'),
(21, 'Frieza Saga', 'Luyện tập đạt 2 tỷ sức mạnh\nLên đường tìm diệt Fide đại ca'),
(22, 'Cell Saga', 'Hãy đến thành phố phía Nam, đảo Balê hoặc Cao nguyên tìm gặp Rôbốt sát thủ để tiêu diệt'),
(23, 'Cell Saga', 'Hãy đến thành phố phía Bắc, ngọn núi phía Bắc hoặc thung lũng phía Bắc tìm diệt bọn Rôbốt sát thủ'),
(24, 'Cell Saga', 'Lên đường tới thị trấn Ginder, tiêu diệt nỗi hiểm họa gần đây tại thị trấn Ginder'),
(25, 'Cell Saga', ''),
(26, 'Cell Saga', ''),
(27, 'Nhiệm vụ mở rộng giao lưu', 'Kết bạn với 15 người tộc Trái đất, Namec, Xayda'),
(28, 'Cell Saga', ''),
(29, 'Tiến đến hành tinh Cold', ''),
(30, 'Tiêu diệt mèo máy Doraemon', ''),
(31, 'Tìm vật phẩm được chỉ định', ''),
(32, 'Multiverse Saga', 'Hành trình đến đa vũ trụ, tìm được nhẫn thời không và tiến đến thời không sai lệch'),
(33, 'Multiverse Saga', 'Thử thách vũ trụ 6');
